commit;

select *
from a_temp_holiday
where (cwid not in
    (select other_id from ids where ids_type_code = 'CID' and id_number in
        (select id_number from a_std_3)))
 minus
select *
from a_temp_holiday
where cwid in
        (select other_id from ids where ids_type_code = 'CID' and id_number in
            (select spouse_id_number from entity where id_number in
                (select id_number from ids where ids_type_code = 'CID' and other_id IN
                    (select cwid from a_temp_holiday))))

select *
from a_temp_holiday
where cwid NOT IN
    (select other_id from ids where ids_type_code = 'CID')